column41:
Je me suis spécialisée, ces 3 derniers semestre, en "Gestion et Ingénierie de l'Environnement"  et les cours qui m'ont le mieux préparés à votre master sont :
- "Introduction to Environmental Communication" (semestre 5 en Suède) qui m'a permis de découvrir les processus de médiation et la théorie derrière les discours que l'on partage et la manière qu'on a de les partager;
- "Gestion patrimoniale des territoires" (semestre 4) où j'ai pu réaliser un audit patrimonial et aller à la rencontre des acteurs et actrices du patrimoine bocager normand. J'ai ainsi pu entendre et étudier différents discours et points de vue sur cet écosystème et comment ces opinions s'imbriquent;
- "Politiques et droit de l'environnement" (semestre 3) qui m'a initié aux problématiques environnementales du point de vue politique et les différentes manières (juridique, politique, scientifique) qu'on a de les interpréter.

- Analyse des comportements politiques ;
- Théorie Politique ;
- Méthode de la science politique.
